import { Button as MUIButton, withStyles } from '@material-ui/core';
import { blueGrey, indigo } from '@material-ui/core/colors';

export const Button = withStyles({
  root: {
    backgroundColor: blueGrey[800],
    color: 'white',
    padding: '20px 30px',
  },
})(MUIButton);
